import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../../services/api';

export default function DonoList() {
  const [donos, setDonos] = useState([]);

  useEffect(() => {
    api.get('/donos').then((res) => setDonos(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Donos Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/donos/novo" className="btn btn-primary">+ Cadastrar Novo Dono</Link>
        </div>
      </div>

      {donos.length === 0 ? (
        <p>Nenhum dono cadastrado ainda.</p>
      ) : (
        <ul className="list-group">
          {donos.map((dono) => (
            <Link
              to={`/donos/${dono._id}`}
              key={dono._id}
              style={{ textDecoration: 'none', color: 'inherit' }}
              className="list-group-item list-group-item-action"
            >
              <strong>{dono.nome}</strong> – CPF: {dono.cpf}
            </Link>
          ))}
        </ul>
      )}
    </div>
  );
}
